import React from 'react';
import './App.css';

const App = () => {
  return (<>
    <main>
      <div className="container-fluid border border-danger" id="mainContainer">
        <div className="row border border-warning">
          <div className="col-lg-4 col-md-3 d-md-block d-none border border-success ml-0 pl-0">
            <div className="card ml-0 pl-0">
              <div className="card-body">

              </div>
            </div>
          </div>
          <div className="col-lg-8 col-md-9 border border-blue"></div>
        </div>
      </div>
    </main>
  </>);
}

export default App;
